textOriginal:
O perfil dos eleitores da esquerda:

● rebeldes sem causa;
● adolescentes tardios;
● marginais de todas espécies;
● frustrados profissionalmente;
● cidadãos que falharam como indivíduo e necessitam do Estado para tutela-los;
● ignorantes de informação;
● doutrinados pelo Gramscismo;

Não pertença a essa horda 🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷

